import icon_deplayed from '../../assets/pictures/icons/checkbox.png';
export default function Pages() {
  return (
      <>
      <h2>Pages</h2>
      <table>
        <th>
          <td><input type='checkbox'></input></td>
          <td>Title</td>
          <td>Author</td>
          <td>Date</td>
          <td><icon alt='deplayed' src={icon_deplayed}></icon></td>
        </th>
        <tr>

        </tr>
      </table>
      </>
  );
}
